import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useAuth } from './AuthContext';
import { useNavigate } from 'react-router-dom';
import ErrorBoundary from './ErrorBoundary';

const Dashboard = () => {
    const { auth, logout } = useAuth();
    const navigate = useNavigate();
    const [quote, setQuote] = useState('');
    const [joke, setJoke] = useState('');
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const [profile, setProfile] = useState({
        name: auth.user?.name || '',
        email: auth.user?.email || '',
        signupDate: auth.user?.createdAt ? new Date(auth.user.createdAt).toLocaleDateString() : 'N/A'
    });
    const [updatingProfile, setUpdatingProfile] = useState(false);
    const [updateMessage, setUpdateMessage] = useState('');

    // Fetch dashboard data
    useEffect(() => {
        let mounted = true;
        const token = localStorage.getItem('token');

        const fetchDashboardData = async () => {
            if (!token) {
                navigate('/login', { replace: true });
                return;
            }

            try {
                const [quoteRes, jokeRes] = await Promise.all([
                    axios.get('https://api.freeapi.app/api/v1/public/quotes', {
                        headers: { Authorization: `Bearer ${token}` }
                    }),
                    axios.get('https://api.freeapi.app/api/v1/public/randomjokes', {
                        headers: { Authorization: `Bearer ${token}` }
                    })
                ]);

                if (mounted) {
                    setQuote(quoteRes.data.data?.[0]?.quote || 'Welcome to your dashboard!');
                    setJoke(jokeRes.data.data?.body || 'Here is a joke for you!');
                    setLoading(false);
                }
            } catch (error) {
                if (mounted) {
                    setError('Unable to load dashboard content');
                    setLoading(false);
                }
            }
        };

        fetchDashboardData();
        return () => { mounted = false; };
    }, []);

    const handleProfileUpdate = async () => {
        setUpdatingProfile(true);
        try {
            await axios.put('https://api.freeapi.app/api/v1/users/update', profile, {
                headers: { Authorization: `Bearer ${auth.token}` }
            });
            setUpdateMessage('Profile updated successfully!');
        } catch (error) {
            setUpdateMessage('Failed to update profile');
        } finally {
            setUpdatingProfile(false);
        }
    };

    return (
        <ErrorBoundary>
            <div className="min-h-screen bg-gray-100">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
                    <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
                        {/* Profile Section */}
                        <div className="bg-white rounded-lg shadow p-6">
                            <h2 className="text-2xl font-bold mb-4">Profile Information</h2>
                            <div className="space-y-4">
                                <div>
                                    <label className="block text-sm font-medium text-gray-700">Name</label>
                                    <input
                                        type="text"
                                        value={profile.name}
                                        onChange={(e) => setProfile({...profile, name: e.target.value})}
                                        className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-blue-500 focus:ring-blue-500"
                                    />
                                </div>
                                <div>
                                    <label className="block text-sm font-medium text-gray-700">Email</label>
                                    <input
                                        type="email"
                                        value={profile.email}
                                        disabled
                                        className="mt-1 block w-full rounded-md border-gray-300 shadow-sm bg-gray-50"
                                    />
                                </div>
                                <div>
                                    <label className="block text-sm font-medium text-gray-700">Signup Date</label>
                                    <p className="mt-1 text-sm text-gray-600">{profile.signupDate}</p>
                                </div>
                                <button
                                    onClick={handleProfileUpdate}
                                    disabled={updatingProfile}
                                    className="w-full bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700 transition-colors"
                                >
                                    {updatingProfile ? 'Updating...' : 'Update Profile'}
                                </button>
                                {updateMessage && (
                                    <p className={`text-sm ${updateMessage.includes('success') ? 'text-green-600' : 'text-red-600'}`}>
                                        {updateMessage}
                                    </p>
                                )}
                            </div>
                        </div>

                        {/* Dashboard Content */}
                        <div className="space-y-6">
                            {loading ? (
                                <div className="bg-white rounded-lg shadow p-6">
                                    <p>Loading dashboard content...</p>
                                </div>
                            ) : error ? (
                                <div className="bg-red-50 rounded-lg shadow p-6 text-red-600">
                                    {error}
                                </div>
                            ) : (
                                <>
                                    <div className="bg-white rounded-lg shadow p-6">
                                        <h2 className="text-xl font-semibold mb-2">Hello, {profile.name}!</h2>
                                        <p className="text-gray-600 italic">"{quote}"</p>
                                    </div>
                                    <div className="bg-white rounded-lg shadow p-6">
                                        <h2 className="text-xl font-semibold mb-2">Daily Joke</h2>
                                        <p className="text-gray-600">{joke}</p>
                                    </div>
                                </>
                            )}
                        </div>
                    </div>

                    <button
                        onClick={logout}
                        className="mt-8 w-full md:w-auto bg-red-600 text-white py-2 px-4 rounded-md hover:bg-red-700 transition-colors"
                    >
                        Logout
                    </button>
                </div>
            </div>
        </ErrorBoundary>
    );
};

export default Dashboard;
